def wrapper(f):
    def fun(l):
        formatted_list = []
        for phone in l:
            if phone[0] == '0':
                new_phone = f"+91 {phone[1:6]} {phone[6:]}"
                formatted_list.append(new_phone)
            elif phone[0] == '9' and len(phone) == 10:
                new_phone = f"+91 {phone[0:5]} {phone[5:]}"
                formatted_list.append(new_phone)
            elif len(phone) == 12:
                new_phone = f"+91 {phone[2:7]} {phone[7:]}"
                formatted_list.append(new_phone)
            elif len(phone) == 13:
                new_phone = f"+91 {phone[3:8]} {phone[8:]}"
                formatted_list.append(new_phone)
        f(formatted_list)
    return fun
